      SELECT + col2 AS col2 FROM tab0 cor0 GROUP BY col2, col1 HAVING NOT + CAST ( col1 AS INTEGER ) * - col2 - + col2 + + ( + col1 ) IS NOT NULL;
  - name: tab0

